import React, { useState } from "react";
import ChatInterface from "./ChatInterface";
import "./ChatInterface.css";
import "../assets/logo.JPG";

const UploadPage = () => {
  const [file, setFile] = useState(null);
  const [tableOfContents, setTableOfContents] = useState([]);
  const [sessionId, setSessionId] = useState(null);
  const [loading, setLoading] = useState(false);
  const [expandedItems, setExpandedItems] = useState({});

  const handleUpload = async () => {
    if (!file) return;
    setLoading(true);

    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await fetch("http://localhost:8000/upload", {
        method: "POST",
        body: formData,
      });

      const data = await response.json();
      setTableOfContents(data.table_of_contents);
      setSessionId(data.session_id);
    } catch (error) {
      console.error("Upload failed:", error);
    } finally {
      setLoading(false);
    }
  };

  const toggleItem = (index) => {
    setExpandedItems((prev) => ({ ...prev, [index]: !prev[index] }));
  };

  return (
    <div
      style={{
        display: "flex",
        height: "100vh",
        fontFamily: "Arial, sans-serif",
        color: "#000000",
      }}
    >
      {/* Sidebar */}
      <div
        style={{
          width: "20%",
          backgroundColor: "#b6dfe9",
          padding: "1rem",
          boxSizing: "border-box",
        }}
      >
        <div style={{ textAlign: "center", marginBottom: "1rem" }}>
          <img src="/assets/logo.JPG" alt="Logo" style={{ maxWidth: "100%" }} />
        </div>
        <input
          type="file"
          onChange={(e) => setFile(e.target.files[0])}
          style={{ marginBottom: "1rem", width: "100%" }}
        />
        <button
          onClick={handleUpload}
          style={{
            width: "100%",
            padding: "0.5rem",
            backgroundColor: "#aaaaaa",
            border: "none",
            cursor: "pointer",
            color: "#000000",
          }}
        >
          Upload PDF
        </button>
        <div style={{ marginTop: "1rem" }}>
          <h3>Table of Contents</h3>
          {tableOfContents.length > 0 ? (
            <ul style={{ listStyle: "none", paddingLeft: 0 }}>
              {tableOfContents.map((item, index) => (
                <li key={index}>
                  <div
                    style={{
                      fontWeight: "bold",
                      cursor: "pointer",
                      marginTop: "0.5rem",
                    }}
                    onClick={() => toggleItem(index)}
                  >
                    {item.heading}
                  </div>
                  {expandedItems[index] && (
                    <ul>
                      {item.children.map((child, i) => (
                        <li key={i} style={{ paddingLeft: "1rem" }}>
                          {child.heading}
                        </li>
                      ))}
                    </ul>
                  )}
                </li>
              ))}
            </ul>
          ) : null}
        </div>
      </div>

      {/* Main content */}
      <div
        style={{
          flex: 1,
          backgroundColor: "#2ea3f2",
          padding: "2rem",
          overflowY: "auto",
        }}
      >
        {loading ? (
          <div style={{ textAlign: "center" }}>
            <p>
              <strong>Loading...</strong>
            </p>
            <p>
              The document is being extracted and indexed. Please wait...
            </p>
          </div>
        ) : sessionId ? (
          <ChatInterface sessionId={sessionId} />
        ) : (
          <div style={{ color: "#000000", maxWidth: "600px", margin: "auto" }}>
            <h2>👋 Welcome! I'm your AI-powered RFQ Assistant.</h2>
            <p>I can help you to:</p>
            <ul>
              <li>Extract and summarize technical and commercial requirements from RFQs</li>
              <li>Compare requirements with previous project submissions and responses</li>
              <li>Highlight overlaps, coverage, and new or missing requirements for bid teams</li>
            </ul>
            <p>Tell me what you are looking for, and I'll help you!</p>
            <strong>Example Prompts:</strong>
            <ol>
              <li>Can you tell me the requirements related to &lt;topic&gt;?</li>
              <li>Can you list down all the requirements related to &lt;topic&gt;?</li>
              <li>
                Can you tell me the requirements related to &lt;topic&gt; and compare it with the
                history submissions?
              </li>
              <li>
                Can you list down all the requirements related to &lt;topic&gt; and compare it with the
                previous responses?
              </li>
            </ol>
          </div>
        )}
      </div>
    </div>
  );
};

export default UploadPage;
